import React from "react";
import { Box, Center, HStack } from "native-base";

export default function App() {
  return (
    <Center h="100vh" bg="coolGray.900">
      <Box position="relative">
        <HStack mb="3" space="3">
          <Box h="150px" w="150px" postion="absolute" roundedTopLeft="full" bg="white"></Box>
          <Box h="150px" w="150px" postion="absolute" roundedTopRight="full" bg="white"></Box>
        </HStack>
        <HStack space="3">
          <Box h="150px" w="150px" postion="absolute" roundedBottomLeft="full" bg="white"></Box>
          <Box h="150px" w="150px" postion="absolute" roundedBottomRight="full" bg="white"></Box>
        </HStack>
      </Box>
    </Center>
  );
}
